            <div class="stl_05 stl_06">
                <div class="stl_01" style="top: 2.3635em; left:14.9142em;"><span class="stl_07" style="font-weight:bold;word-spacing:0em;">SERVICIO DE ATENCIÓN DE PSICOLOGÍA &nbsp;</span></div>
                <div class="stl_01" style="top: 3.4935em; left:14.9142em;"><span class="stl_07" style="font-weight:bold; word-spacing:0.01em;">CONSENTIMIENTO INFORMADO ADULTO &nbsp;</span></div>
                <div class="stl_01" style="top: 4.6235em; left:18.6842em;"><span class="stl_07" style="font-weight:bold; word-spacing:0em;">HOSPITALIZADO - PAD &nbsp;</span></div>
                <div class="stl_01" style="top: 8.7885em; left:4em;"><span class="stl_08 stl_09" style="font-weight:bold; word-spacing:0em;">Fecha:&nbsp;</span> {{$today}}</span></span></div>
                <div class="stl_01" style="top: 12.2085em; left:4em;"><span class="stl_08 stl_09" style="font-weight:bold; word-spacing:0em;">Nombre del Paciente: &nbsp;</span> {{$consentsinformed[0]['admissions']['patients']['firstname']}} {{$consentsinformed[0]['admissions']['patients']['middlefirstname']}} {{$consentsinformed[0]['admissions']['patients']['lastname']}} {{$consentsinformed[0]['admissions']['patients']['middlelastname']}} <span class="stl_08 stl_09" style="font-weight:bold; word-spacing:0em;"> N° Identificación: &nbsp;</span>{{$consentsinformed[0]['admissions']['patients'] ['identification']}} </span></span></div>
                <div class="stl_01" style="top: 15.6185em; left:4em;"><span class="stl_08 stl_10" style="font-weight:bold; word-spacing:0.18em;">Señor(a) Usuario, este documento que tiene como</span><span class="stl_08 stl_10" style="font-weight:bold; word-spacing:0.18em;">&nbsp;objetivo explicarle sus derechos y compromisos</span><span class="stl_08 stl_10" style="font-weight:bold; word-spacing:0.13em;">&nbsp;con &nbsp;</span></div>
                <div class="stl_01" style="top: 16.6585em; left:4em;"><span class="stl_08 stl_10" style="font-weight:bold; word-spacing:0.06em;">respecto al proceso de atención por parte del servicio de psicología como paciente de Health &amp; Life IPS. &nbsp;</span></div>
                <div class="stl_01" style="top: 18.3585em; left:4em;"><span class="stl_08" style="font-weight:bold;">1.</span></div>

                <div class="stl_01" style="top: 18.3585em; left:5.672em;"><span class="stl_08 stl_10" style="font-weight:bold; word-spacing:0.18em;">USO Y CONFIDENCIALIDAD DE LOS DATOS</span><span class="stl_08 stl_10" style="word-spacing:0.14em;">&nbsp;</span><span class="stl_08 stl_09" style="word-spacing:0.14em;">Entiendo que toda la</span><span class="stl_08 stl_10" style="word-spacing:0.2em;">&nbsp;información concerniente a</span><span class="stl_08 stl_10" style="word-spacing:0.14em;">&nbsp; &nbsp;</span></div>
                <div class="stl_01" style="top: 19.3985em; left:4em;"><span class="stl_08 stl_10" style="word-spacing:0.18em;">mi evaluación y tratamiento es confidencial y no será divulgada ni entregada a ninguna otra institución</span><span class="stl_08 stl_10" style="word-spacing:0.13em;">&nbsp;o &nbsp;</span></div>
                <div class="stl_01" style="top: 20.441em; left:4em;"><span class="stl_08 stl_10" style="word-spacing:0.13em;">individuo sin mi consentimiento expreso,excepto</span>cuando</span>la orden</span>de entrega</span>provenga de</span><span class="stl_08 stl_10" style="word-spacing:0.06em;">&nbsp;una autoridad &nbsp;</span></div>
                <div class="stl_01" style="top: 21.481em; left:4em;"><span class="stl_08 stl_09" style="word-spacing:0.06em;">judicial competente. También</span></span><span class="stl_08 stl_10" style="word-spacing:0.12em;">&nbsp;entiendoy,</span><span class="stl_08 stl_10" style="word-spacing:0.08em;">&nbsp;porlo tanto,estoy de acuerdo con la necesidad</span><span class="stl_08 stl_10" style="word-spacing:0.08em;">&nbsp;de</span><span class="stl_08 stl_10" style="word-spacing:0.14em;">&nbsp;quebrantar &nbsp;</span></div>
                <div class="stl_01" style="top: 22.521em; left:4em;"><span class="stl_08 stl_10" style="word-spacing:0.2em;">este principio de confidencialidad en caso de presentarse situaciones que</span><span class="stl_08 stl_10" style="word-spacing:0.17em;">&nbsp;pongan en grave peligro</span><span class="stl_08 stl_10" style="word-spacing:0.15em;">&nbsp;mi &nbsp;</span></div>
                <div class="stl_01" style="top: 23.561em; left:4em;"><span class="stl_08 stl_10" style="word-spacing:0.02em;">integridad física, mental o de algún miembro de la comunidad. La valoración de la gravedad de la situación &nbsp;</span></div>
                <div class="stl_01" style="top: 24.601em; left:4em;"><span class="stl_08 stl_10" style="word-spacing:0.04em;">estará sujeta a bajo los lineamientos de la ley 1090 del 2006, lo anterior será puesto en mi conocimiento, &nbsp;</span></div>
                <div class="stl_01" style="top: 25.641em; left:4em;"><span class="stl_08 stl_10" style="word-spacing:0.05em;">pero no tiene que contar con mi aceptación expresa. &nbsp;</span></div>
                <div class="stl_01" style="top: 27.721em; left:4em;"><span class="stl_08" style="font-weight:bold;">2.</span></div>
                <div class="stl_01" style="top: 27.721em; left:5.26em;"><span class="stl_08" style="font-weight:bold;"></span></div>
                <div class="stl_01" style="top: 27.721em; left:5.672em;"><span class="stl_08 stl_09" style="font-weight:bold;">TRATAMIENTO</span></span><span class="stl_08 stl_10" style="word-spacing:0.02em;">&nbsp;</span><span class="stl_08" style="word-spacing:0.02em;">El tratamiento que recibiré</span><span class="stl_08 stl_10" style="word-spacing:0.02em;">&nbsp;es fundamentado</span><span class="stl_08 stl_10" style="word-spacing:0.04em;">&nbsp;bajo el</span>modelo psicológico</span><span class="stl_08 stl_10" style="word-spacing:0.06em;">&nbsp;basado</span><span class="stl_08 stl_10" style="word-spacing:0.02em;">&nbsp;en &nbsp;</span></div>
                <div class="stl_01" style="top: 28.761em; left:4em;"><span class="stl_08 stl_10" style="word-spacing:0.13em;">la evidencia,</span><span class="stl_08 stl_10" style="word-spacing:0.06em;">&nbsp;con</span><span class="stl_08 stl_10" style="word-spacing:0.05em;">&nbsp;el fin depropender</span><span class="stl_08 stl_10" style="word-spacing:0.05em;">&nbsp;por un</span><span class="stl_08 stl_10" style="word-spacing:0.08em;">&nbsp;proceso eficaz y eficiente,</span><span class="stl_08 stl_10" style="word-spacing:0.05em;">&nbsp;de igual</span><span class="stl_08 stl_10" style="word-spacing:0.08em;">&nbsp;forma,entiendo</span><span class="stl_08 stl_10" style="word-spacing:0.05em;">&nbsp;que</span><span class="stl_08 stl_10" style="word-spacing:0.05em;">&nbsp;dicho &nbsp;</span></div>
                <div class="stl_01" style="top: 29.791em; left:4em;"><span class="stl_08 stl_10" style="word-spacing:0.06em;">tratamiento se le realizarán ajustes de ser necesario durante el tiempo de la intervención. &nbsp;</span></div>
                <div class="stl_01" style="top: 31.871em; left:4em;"><span class="stl_08" style="font-weight:bold;">3.</span></div>
                <div class="stl_01" style="top: 31.871em; left:5.26em;"><span class="stl_08" style="font-weight:bold;"></span></div>
                <div class="stl_01" style="top: 31.871em; left:5.672em;"><span class="stl_08 stl_09" style="font-weight:bold; word-spacing:0.21em;">REVOCACIÓN DEL CONSENTIMIENTO</span></span><span class="stl_08 stl_10" style="word-spacing:0.21em;">&nbsp;</span><span class="stl_08 stl_10" style="word-spacing:0.3em;">Las decisiones sobre</span><span class="stl_08 stl_10" style="word-spacing:0.26em;">&nbsp;la continuidad o suspensión de</span><span class="stl_08 stl_10" style="word-spacing:0.23em;">&nbsp;las &nbsp;</span></div>
                <div class="stl_01" style="top: 32.911em; left:4em;"><span class="stl_08 stl_10" style="word-spacing:0.19em;">actividades programadas por el/la psicólogo(a) para la evaluación y el tratamiento de</span><span class="stl_08 stl_10" style="word-spacing:0.14em;">&nbsp;la</span><span class="stl_08 stl_10" style="word-spacing:0.22em;">&nbsp;problemática &nbsp;</span></div>
                <div class="stl_01" style="top: 33.951em; left:4em;"><span class="stl_08 stl_10" style="word-spacing:0.06em;">abordada, son tomadas por mí. &nbsp;</span></div>
                <div class="stl_01" style="top: 36.0327em; left:4em;"><span class="stl_08 stl_10" style="word-spacing:0.1em;">Recuerde que elproceso de</span><span class="stl_08 stl_10" style="word-spacing:0.12em;">&nbsp;atención</span><span class="stl_08 stl_10" style="word-spacing:0.13em;">&nbsp;psicológica requiere</span><span class="stl_08 stl_10" style="word-spacing:0.06em;">&nbsp;de su</span><span class="stl_08 stl_10" style="word-spacing:0.16em;">&nbsp;compromiso</span><span class="stl_08 stl_10" style="word-spacing:0.12em;">&nbsp;y participación, además</span>de &nbsp;</span></div>
                <div class="stl_01" style="top: 37.0727em; left:4em;"><span class="stl_08 stl_10" style="word-spacing:0.32em;">su colaboración en diligenciar o responder una</span><span class="stl_08 stl_10" style="word-spacing:0.29em;">&nbsp;serie de documentos y/o</span><span class="stl_08 stl_10" style="word-spacing:0.35em;">&nbsp;pruebas psicológicas,</span><span class="stl_08 stl_10" style="word-spacing:0.26em;">&nbsp;con &nbsp;</span></div>
                <div class="stl_01" style="top: 38.1127em; left:4em;"><span class="stl_08 stl_10" style="word-spacing:0.07em;">información personal que será utilizada por el/la profesional para la evaluación y tratamiento. &nbsp;</span></div>
                <div class="stl_01" style="top: 40.1927em; left:4em;"><span class="stl_08 stl_10" style="word-spacing:0.02em;">Por lo anterior, entiendo y acepto en forma expresa a ustedes que he leído y comprendo íntegramente este &nbsp;</span></div>
                <div class="stl_01" style="top: 41.2327em; left:4em;"><span class="stl_08 stl_10" style="word-spacing:0.12em;">documento y en consecuenciaaceptosu contenido</span>y</span><span class="stl_08 stl_10" style="word-spacing:0.12em;">&nbsp;las consecuencias</span><span class="stl_08 stl_10" style="word-spacing:0.08em;">&nbsp;que de él</span><span class="stl_08 stl_10" style="word-spacing:0.08em;">&nbsp;sederiven,</span><span class="stl_08 stl_10" style="word-spacing:0.13em;">&nbsp;finalmente &nbsp;</span></div>
                <div class="stl_01" style="top: 42.2727em; left:4em;"><span class="stl_08">declaro: &nbsp;</span></div>
                <div class="stl_01" style="top: 44.3509em; left:6.222em;"><span class="stl_11">•</span></div>
                <div class="stl_01" style="top: 44.4327em; left:7.722em;"><span class="stl_08 stl_09" style="word-spacing:-0.05em;">Que la información que le brindo al psicólogo/a es verdad y corresponde a mi realidad, ya que sobre &nbsp;</span></span></div>
                <div class="stl_01" style="top: 45.4726em; left:7.722em;"><span class="stl_08 stl_10" style="word-spacing:0.07em;">dicha información se plantean las propuestas de intervención. &nbsp;</span></div>
